import React from 'react'


const List = ({items}) =>{
    return (
        <ul className="todo__list">
            {
               items.map(obj =>  <li className="active">
                <i>obj.icon</i> 
                <span>obj.name</span>
                </li>)
            }
        </ul> 
    );
};

export default List;
